import './Sidebar.css';

const Sidebar = () => {
  return (
    <>
      <aside>
        <div>
          <figure>
            <img src={require('../../images/profile/kurumi-avatar.png')} alt="" />
          </figure>
        </div>
      </aside>
    </>
  )
}

export default Sidebar;
